import React from 'react'
import './Header.css'

function Header() {
    return (
            <header>
                <span className="black inline-flex">
                    <span className="material-icons arrow-back">arrow_right_alt</span>
                    <span className='text'>Realizacje</span>
                </span>
            </header>
    )
}

export default Header
